  loadMap(container)
  {

    this.platform.ready().then(() => {
      let latLng;
      let zoom;
      if (this.lat != 0){
        latLng = new google.maps.LatLng(this.lat, this.lng);
        zoom = 17
        this.hasRequested = false;
      }else{
        latLng = new google.maps.LatLng(5.4982219, 7.5019607);
        zoom = 6
        this.hasRequested = true;
      }

      clearTimeout(myTime)

      var icon = {
        url: "data:image/png;base64,",
        scaledSize: new google.maps.Size(30, 30), // scaled size
     
    };
      
     
         let mapOptions = {
           center: latLng,
           zoom: zoom,
           minZoom: 6,
           mapTypeId: google.maps.MapTypeId.ROADMAP,
           disableDefaultUI: true
         }
         
    
     this.map = new google.maps.Map(container, mapOptions);
     

         
         this.marker = new google.maps.Marker({
          position: latLng,
          icon: icon
         });

         this.marker.setMap(this.map);


        var antennasCircle = new google.maps.Circle({
          strokeColor: "#5992F5",
          strokeOpacity: 0.8,
          strokeWeight: 2,
          fillColor: "#5992F5",
          fillOpacity: 0.35,
          map: this.map,
          center: latLng,
          radius: 200
        });
        
        
         
       var circTime =  setTimeout(()=>{
         antennasCircle.setRadius(0)
           }, 3000)

              let center;
          
         
               this.map.addListener('dragstart',  () =>{
                 if (!this.hasRequested){
                this.anim.toggleFlipAnim('notFlipped');
                this.onLocationbarHide = false
                this.isCarAvailable = false;
                this.anim.toggleFlyOutAnim('out');
                clearTimeout(this.timetoRefr)
                this.onDestinatiobarHide = false
                antennasCircle.setRadius(0);
                clearTimeout(circTime);
                  }
               });


               this.map.addListener('dragend', () =>{
                if (!this.hasRequested){
                this.anim.toggleFlipAnim('flipped');
                 this.onLocationbarHide = true
                 this.isCarAvailable = true;
                 
                center = this.map.getCenter();
                this.lat = center.lat();
                this.lng = center.lng();

                if (this.locations != null)
                this.showCloseDrivers(this.lat, this.lng)

                this.gcode.Reverse_Geocode(center.lat(), center.lng(), this.map, false)
                }
               });

         
               if (google && google.maps) {
                if (this.lat != 0){
                 this.anim.toggleFlipAnim('flipped');
                 this.gcode.Reverse_Geocode(this.lat, this.lng, this.map, false)
                 var myTime = setTimeout(() => {
                  this.showDriversOnMap();
                 // this.moveUser();
                 }, 3000);
              
               
                }else{
                 
                  console.log("has request")
                  this.anim.toggleFlipAnim('notFlipped');
                  this.gcode.Reverse_Geocode(this.lat, this.lng, this.map, false)
                }
             }
      })


      }


      RefreshMap(address){
       // google.maps.event.trigger(this.map, 'resize');
     
       var geocode = new google.maps.Geocoder;
       geocode.geocode( { 'address': address}, (results, status) => {
        if (status == 'OK') {
         var position = results[0].geometry.location
         let matLatr = new google.maps.LatLng(position.lat(), position.lng());
         
         this.map.setCenter(matLatr);
         console.log(this.lat)
        } else {
         // alert('Geocode was not successful for the following reason: ' + status);
        }
      });

          
       
    
      }


